ムーニー おしりふき トイレに流せる やわらか素材 本体 50枚<br>ブランド：ムーニー<br>販売・製造元：ユニ・チャーム<br><br>やさしく拭けて、トイレに簡単ポイッとすてられるおしりふきです。<br>マイクロファイバーを水でふんわり織り上げているので、水解シート特有の紙っぽさがなく、驚きのやわらかさを実現。<br>また、きめ細やかな背にが水分をたっぷり含むので、こびりつきウンチも軽い力で拭き取ることができます。<br>水に溶けやすいサラッと水解仕立てで、トイレに流せます。<br>ノンアルコール・無香料。<br>手や体にも使えます。<br>パッケージが異なる事がございますが、予めご了承ください。<br>  <br><br><br>使用上の注意<br>●シートは、上にまっすぐやさしく引くように取り出してください。●傷やはれもの、湿疹等のある部分には使用しないでください。●お肌に合わない時は、ご使用をおやめください。●中身の乾燥を防ぐためフタをしっかり閉めて保管してください。●トイレのつまりを避けるため必ず1-2枚ずつ流してください。●直射日光や高温になる場所は避けて保管してください。●乳幼児の手の届かない所に保管してください。●容器の内側や袋は常に清潔にしてお使いください。●つめかえの時は、きれいな手で詰め替えてください。●「ムーニーおしりふき トイレに流せるやわらか素材」専用容器につめかえてご使用ください。●温めるとティッシュが変色する場合があります。変色したティッシュを取り除いて、ご使用ください。 成分水、PG、メチルパラベン、エチルパラベン、ポリアミノプロピルビグアニド、ブチルカルバミン酸ヨウ化プロピニル、EDTA-2Na<br> 原産国日本 <br><br>お問い合わせ先<br>ユニ・チャーム株式会社 お客様相談ダイヤル：0120-192-862受付時間(祝日を除く)月曜日-金曜日/9：30-17：00 <br>ベビー＆キッズ／衛生・入浴用品／衛生用品／おしりふき(ベビー)<br>JANコード： 4903111244867<br><br>CS：12<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
